        print("FizzBuzz")
    elif (i+1)%3==0 and (i+1)%4==0:
        print("FizzBar")
    elif (i+1)%5==0 and (i+1)%4==0:
        print("BuzzBar")
    elif (i+1)%3==0:
        print("Fizz")
    elif (i+1)%4==0:
        print("Bar")
    elif (i+1)%5==0:
        print("Buzz")
